		/*
	 	 * Turn properly formated HTML into tab based content (one of the following two functions)
	 	 */
		function tabify(el, className) {
		    if ($(el).length) {
				if(jQuery.browser.version <= 418.8 && $.browser.safari) {
					$("body").addClass("safari");
				}
				var container = $(el);
				container.attr("class", className);
				$(el + " div h2").click(function() {
					var id = $(this).parent().attr("id");
					container.attr("class", id);
				});
		    }
		}
		function tabify(el, className) {    
			var container = $(el);
			container.attr("class", className);
			
			$(el + " div h2").click(function() {
				var id = $(this).parent().attr("id");
				if(container.hasClass("short")) {
					container.attr("class", id);
				}
				else {
					container.attr("class", id);
				}
				container.addClass("short");
			});
		}
			  
		/* multiTabify
		 * Creates 1-4 tabs based on the number of divs. Click on the tab and changes which is displayed
		 */
		function multiTabify(el, className) {
		    if ($(el).length) {
				if(jQuery.browser.version<=418.8&&$.browser.safari) { 
				    $("body").addClass("safari");
				}
				$(el).find(".readmore").each(function() { 
							 var link = $(this).html();
							 $(this).parent().find("ul").append("<li class=\"news-events-link\">"+link+"</li>");
							 $(this).remove();
						     });

				var container = $(el);
				container.attr("class",className);
				$(el+" div h2").click(function() {
							  $(this).parent().parent().find(".showThis").removeClass("showThis").addClass("hideThis");
							  $(this).parent().removeClass("hideThis").addClass("showThis");
							  addJScrollPane("#modMultitab .tabListing.showThis>ul");
						      });
				//Overlay tabs
				var numTabs=$('.tabListing h2.tab').length;
				$('.tabListing h2.tab').each(function(i) {
							 $(this).attr("style","left: " + 127*i + "px");
							 if (i == 0){
							     $(this).parent().addClass("showThis");
							 } else {
							     $(this).parent().addClass("hideThis");
							 }
				});
				$(el).addClass("tabs"+numTabs);
				//$("#modMultitab .tabListing>ul").wrap("<div/>");
				addJScrollPane("#modMultitab .tabListing>ul");
		    }
		}



		/**********************************************************/
		/*  --------   |\   /|     /\     +------  +-----  +----- */
