		/*  getRandomValues(fromVal,toVal)                   */
		/*****************************************************/

		/* setupPhotoRotation
		 * Takes a list of photos and rotates through them
		 */
		function setupPhotoRotation() {
			//get all rotator div's
			var rotator = $('[id*=rotator-]');
		
			rotator.each(function(index){	
				var rotatorId = $(this).attr('id');//$(rotator[index]).attr('id');

				// get all images for current rotator
				var fadeImage = $('#' + rotatorId +' img');
			
				//get all images src's
				var fadeImageSrc = new Array();
				for(i=0; i<fadeImage.length; i++) {
					fadeImageSrc[i] = $(fadeImage[i]).attr('src');
				}
			
				// generate random z-index's for images
				var fadeImagesZidx	= new Array();
				fadeImagesZidx	= getRandomValues(0, fadeImage.length-1);
	
				for(i=0; i<fadeImage.length; i++) {
					$(fadeImage[i]).attr('src', fadeImageSrc[fadeImagesZidx[i]]);
				}
			
				var params = rotatorId.split('-');
				$('#' + rotatorId ).css({'display': 'block'});
				$('#' + rotatorId ).cycle({fx: params[1], timeout: params[2]});
			});	
		}	

		/* setupMediaPicker
		 *
		 */
		function setupMediaPicker() {
		    if ($(".mediaPickerContainer").length) {
				$(".mediaPickerTabs div").each(
						       function(intIndex){
							   $(this).bind("click", function() {
									    switchTab(intIndex, this);
									});
						       });
				$("#currentTab").html($("#tab0").html());
				$("#web2").after("<div class=\"shift\"/>");
			
				//function to support tab switch on the media picker page.
				function switchTab(whichTab, currentObject) {
				    $("#currentTab").html($("#tab"+whichTab).html());
				    allImages=$( ".mediaPickerTabs" );
				    $( ".mediaPickerTabs div" ).each(             
							     function( intIndex ){$( this ).removeClass ("selected");
							     });
				    $(currentObject).addClass("selected");
				}
		    }
		}
	
		/* setupGallery
		 * Takes a list of photos and turns them into a scrollable list with the ability to view larger photos
		 */
		function setupGallery() {
		  if($(".photogallery").length) {
			var globaltitle = $(".photogallery h2").text();
			$(".photogallery h2").css("display", "none");
			$('.photogallery ul').wrap("<div class=\"scroller\"/>");
			$('.photogallery img').attr("width", "106");
			$('.photogallery').append("<div class='viewer'></div>");
			$(".photogallery .scroller p").css("display", "none");
		
			$(".photogallery .scroller img").each(function() {
		
			  $(this).fadeTo('fast', 0.5);
			
			  $(this).click(function() {
				$(".viewer").html("<img src=\"" + $(this).attr("src") + "\"/><p/>");
				if($(this).parent().find("p").text() != "") {
				  $(".viewer p").html($(this).parent().find("p").text());
				} else {
				  $(".viewer p").html(globaltitle);
				}
				$(".photogallery .selected").fadeTo('slow', 0.5).removeClass("selected");
				$(this).addClass("selected").fadeTo('slow', 1.0);
			  });
		
			  $(this).hover(function() {
				$(this).fadeTo('fast', 1.0);
			  }, function() {
				if(!$(this).hasClass("selected")) {
				  $(this).fadeTo('fast', 0.5);
				}
			  });
		
			});
			addJScrollPane(".photogallery .scroller");
		
			$(".photogallery ul li:first img").click();
		  }
		}

