		/* setupYoutube
		 * Finds the youtube module then takes the link to the playlist, extract the playlist id, generate a JSON call,
		 * then display the images for each video on the right and a youtube player on the right
		 *
		 * Relies on https://www.youtube.com/iframe_api
		 */
		function setupYoutube(selector) {
			if ($("#youtube").length > 0) {
				// Initialize the youtube object
				wpi["youtube"] = {
					"player": 0,
					"TopShown":	0,
					"Videos": [],
					"NewVideo": false,
					"carousel": 0,
					"CurrentlyPlaying": 0,
					"UpdateInfo": function() {
							$("#youtube #currentvideo h3").text(this.Videos[this.CurrentlyPlaying].title);
							$("#youtube #currentvideo p").text(this.Videos[this.CurrentlyPlaying].description);
						},
					"onPlayerStateChange": function(event) {
							if (event.data == 0) {
								wpi["youtube"].NewVideo = true;
							} else if (event.data == -1 && wpi["youtube"].NewVideo) {
								if(wpi["youtube"].CurrentlyPlaying == wpi["youtube"].length-1) {
									wpi["youtube"].CurrentlyPlaying = 0;
								} else {
									wpi["youtube"].CurrentlyPlaying++
								}
								wpi["youtube"].UpdateInfo();		
							} else {
								wpi["youtube"].NewVideo = false;
							}
						}
				};


				$("#youtube h2").after("<div id=\"currentvideo\"><div id=\"player\"></div><h3></h3><p></p></div>");
				if (!isMobile) {
				    $("#youtube").prepend("<div id=\"ytscroller\"><div id=\"ytplaylist\"><ul></ul></div>");
				    $("#youtube").after("<div id=\"youtubetitles\"><div class=\"title1\"></div><div class=\"title2\"></div><div class=\"title3\"></div></div>");
				} else {
				    $("#youtube").after("<div id=\"ytscroller\"><div id=\"ytplaylist\"><ul></ul></div>");
				}
				var playlistUrl = $("#youtube a").attr("href");
				var playlistid;
				if (playlistUrl.indexOf("playlist") > -1) {
					// 2015+ style playlist URL like: https://www.youtube.com/playlist?list=PLAD192BFC56EC7A0A
					playlistid = playlistUrl.replace(/.*list=([^&]+).*/, "$1");
					//console.log('new playlist');
				} else {
					// old style like: http://www.youtube.com/user/wpibme#p/c/AD192BFC56EC7A0A
					playlistid = playlistUrl.replace(/.*\/([a-zA-Z0-9]*)\/?/, "$1");
					//console.log('old playlist');
				}
				//console.log('playlist id: ' + playlistid);
				// old, v2 API
				//var playlist = "http://gdata.youtube.com/feeds/api/playlists/"+playlistid+"?v=2&alt=jsonc&max-results=10&orderby=position&callback=?";
				// add &callback=? in order for getJSON to work on IE9 and lesser
				var playlist = "https://www.googleapis.com/youtube/v3/playlistItems?key=AIzaSyC3r_yGbuBHdsx0btpkoEaHFmkKqBBfbrs&maxResults=50&part=snippet,contentDetails&playlistId=" + playlistid + "&callback=?";
				$.getJSON(playlist,
					function(data) {
						$.each(data.items, function(i, item) {
							videoId = item.snippet.resourceId.videoId;
							videoTitle = item.snippet.title;
							videoDescription = item.snippet.description;
							videoThumbnail = item['snippet']['thumbnails']['default']['url'];
							if (!isMobile) {
							    $("#ytplaylist ul").append("<li><a href=\"http://www.youtube.com/watch?v="+videoId+"\" class=\""+i+"\" ><img src=\""+videoThumbnail+"\" /></a><span class=\"playbutton\"><\/span><\/li>");
							} else {
							    $("#ytplaylist ul").append("<li><a href=\"http://www.youtube.com/watch?v="+videoId+"\" class=\""+i+"\" >"+videoTitle+"</a></li>");
							}
							wpi["youtube"].Videos[i] = { "id": videoId, "description": videoDescription, "title": videoTitle };
						});
			
						wpi["youtube"].player = new YT.Player("player", {
							height: 210,
							width: 329,
							videoId: wpi["youtube"].Videos[0].id,
							events: {
								'onStateChange': wpi["youtube"].onPlayerStateChange
							},
							playerVars: {
								'rel': 0,
								wmode: 'transparent'
							}
						});
						wpi["youtube"].UpdateInfo();
						if (!isMobile) {
						    wpi["youtube"].carousel = $("#ytplaylist ul").jcarousel({
							vertical: true,
							scroll: 1,
							animation: "slow",
							wrap: "circular",
							visible: 3
						    });
						}
						$("#youtube li").click(function(event) {
							event.preventDefault();
							ytid = $(this).find("a").attr("class");
							wpi["youtube"].player.loadVideoById(wpi["youtube"].Videos[ytid].id);
							wpi["youtube"].CurrentlyPlaying = ytid;
							wpi["youtube"].UpdateInfo();
						});

						$("#youtubetitles .title1").html("").hide();
						$("#youtubetitles .title2").html("").hide();
						$("#youtubetitles .title3").html("").hide();

						$("#youtube li").hover(function(event) {
							ytid = $(this).find("a").attr("class");
							offset = parseInt($("#ytplaylist ul").css("top"), 10)/-95;
							first = $("#ytplaylist ul li:eq("+offset+") a").attr("class");
							second = $("#ytplaylist ul li:eq("+(offset+1)+") a").attr("class");
							third = $("#ytplaylist ul li:eq("+(offset+2)+") a").attr("class");
							pos = 1;
							if (ytid == first) {
								pos = 1;
							} else if (ytid == second) {
								pos = 2;
							} else {
								pos = 3;
							}
							$("#youtubetitles .title"+pos).html("<p>"+wpi["youtube"].Videos[ytid].title+"</p>").show();
						},
						function(event) {
							$("#youtubetitles .title1").html("").hide();
							$("#youtubetitles .title2").html("").hide();
							$("#youtubetitles .title3").html("").hide();
						});
					});
			}
		}
		
		function setupRotatingBillboard() {
		    if ($("#rotatingbillboard").length > 0) {
			wpi["rotatingbillboard"] = {
			    "player": [ ],
			    "initSize": 0,
			    "stopRotating": false,
			    "setupRotation": function() {
				wpi["rotatingbillboard"].initSize = $("#rotatingbillboard ul.windows li").length;
				$('#rotatingbillboard ul.windows').jcarousel({
					scroll: 1,
					    visible: 1,
					    auto: 6,
					    animation: 'slow',
					    wrap: 'circular',
					    buttonNextHTML: null,
					    buttonPrevHTML: null,
					    initCallback: wpi["rotatingbillboard"].callback,
					    itemLastOutCallback: { onBeforeAnimation: wpi["rotatingbillboard"].reInitYT },
					    itemFirstInCallback: { onAfterAnimation: wpi["rotatingbillboard"].change }
				    });
			    },
			    "callback": function(carousel) {
				carousel.clip.hover(function() {
							carousel.stopAuto();
						    }, function() {
							if (!wpi["rotatingbillboard"].stopRotating){
							    carousel.startAuto();
							}
						    });
				
				//Setup controls
				$("#rotatingbillboard").append("<div class=\"controls\"></div>");
				controls = $("#rotatingbillboard .controls");
				for(i=1; i<carousel.size(); i++) {
				    if (i==1) { selected = " displayed"; }
				    else { selected = ""; }
				    controls.append("<span class=\"page page"+i+selected+"\">"+i+"</span>");
				}
				controls.append("<span class=\"page page0\">"+i+"</span>");
				controls.prepend("<span class=\"prevpage\">&nbsp;</span>");
				controls.append("<span class=\"nextpage\">&nbsp;</span>");
				
				$("#rotatingbillboard .video").bind("click", function() {
									carousel.startAuto(0);
								    });
				
				$("#rotatingbillboard .controls .page").bind("click", function() {
										 if (Math.abs(parseInt($(this).text() - (carousel.first % carousel.size()))) > carousel.size()/2) {
										     carousel.scroll(carousel.first - (carousel.first % carousel.size()) - carousel.size() + parseInt($(this).text()));
										 } else {
										     carousel.scroll(carousel.first - (carousel.first % carousel.size()) + parseInt($(this).text()));
										 }
										 carousel.startAuto(0);
										 return false;
									     });
				
				$("#rotatingbillboard .controls .nextpage").bind("click", function() {
										     carousel.scroll(carousel.first+1);
										 });
				$("#rotatingbillboard .controls .prevpage").bind("click", function() {
										     carousel.scroll(carousel.first-1);
										 });
				wpi["rotatingbillboard"].setupYT();
			    },
			    "setupYT": function() {
				if (ytready || typeof YT != 'undefined') {
				    try {
					for(i=1; i<=wpi["rotatingbillboard"].initSize; i++) {
					    if ($("#rotatingbillboard .jcarousel-item-"+i+" .video").length > 0) {
						$("#rotatingbillboard .jcarousel-item-"+i+" .video").each(function() {
													      $(this).append("<div id=\"player"+i+"\" class=\"videoplayer\"></div>");
													      wpi["rotatingbillboard"].player[i] = new YT.Player("player"+i,
																				 {
																				     height: 277,
																					 width: 503,
																					 videoId: $(this).attr("title"),
																					 events: {
																					 'onStateChange': wpi["rotatingbillboard"].onPlayerStateChange
																					     },
																					 playerVars: {
																					 'rel': 0
																					     }
																				 });
													  });
					    }
					}
				    } catch (err) {
					setTimeout('wpi["rotatingbillboard"].setupYT()', 100);
				    }
				} else {
				    setTimeout('wpi["rotatingbillboard"].setupYT()', 100);
				}
			    },
			    "change": function(carousel) {
				$("#rotatingbillboard .displayed").removeClass("displayed");
				$("#rotatingbillboard .controls .page"+(carousel.first%carousel.size())).addClass("displayed");
			    },
			    "onPlayerStateChange": function(event) {
				//console.log(event.data);
				// console.log(event);
				var done = false;
				if (event.data == YT.PlayerState.PLAYING && !done) {
				    //alert(event.target.f.videoData.title+ ' ' + event.target.f.videoData.video_id);
				    done = true;
				}
				
				if (event.data == 0) {
				    pageTracker._trackEvent($("#navigation h3 a").text(), "Billboard Video", event.target.f.videoData.video_id+" Finished");
				    //$("#header").append("ended" + event.getVideoEmbedCode());
				} else if (event.data == 1) {
				    pageTracker._trackEvent($("#navigation h3 a").text(), "Billboard Video", event.target.f.videoData.video_id+" Started");
				    //$("#header").append("playing" + event.getVideoEmbedCode());
				    wpi["rotatingbillboard"].stopRotating = true;
				}
				//pageTracker._trackEvent("Questionaire", window.location, winnerslist);
			    },
			    "reInitYT":function (carousel){
				if(carousel.first > (2*wpi["rotatingbillboard"].initSize)) {
				    carousel.stopAuto();
				    wpi["rotatingbillboard"].stopRotating = true;
				}
				
				if(carousel.first > 0 && carousel.first <= wpi["rotatingbillboard"].initSize) {
				    if($("#rotatingbillboard .jcarousel-item-"+(carousel.first+1)+" .video").length > 0) {
					wpi["rotatingbillboard"].player[carousel.first+1].stopVideo();
				    }
				    if($("#rotatingbillboard .jcarousel-item-"+(carousel.first-1)+" .video").length > 0) {
					wpi["rotatingbillboard"].player[carousel.first-1].stopVideo();					
				    }
				} else if($("#rotatingbillboard .jcarousel-item-"+carousel.first+" .video").length > 0 ) {
				    $("#rotatingbillboard .jcarousel-item-"+carousel.first+" .video").each(function(index) {
													       $(this).find(".videoplayer").remove();
													       $(this).append("<div id=\"player"+carousel.first+"\" class=\"videoplayer\"></div>");
													       wpi["rotatingbillboard"].player[index] = new YT.Player("player"+carousel.first,
																				      {
																					  height: 277,
																					      width: 503,
																					      videoId: $(this).attr("title"),
																					      events: {
																					      'onStateChange': wpi["rotatingbillboard"].onPlayerStateChange
																						  },
																					      playerVars: {
																					      'rel': 0
																						  }
																				      });
													   });
				}
			    }
			}
			wpi["rotatingbillboard"].setupRotation();
		    }
		}
			   
		
