		/**
		 * MessageWindow
		 */
		var MessageWindowDisplayed = 0;
		var MessageWindowIntervaler;
		var MessageWindowPlayingVideoId = '';
		function MessageWindowFadeTo(index) {
			pauseVideoMessageWindow();
			if (index >= $("#MessageWindow > ul > li").length) { index = 0; }
			if (index < 0) { index = $("#MessageWindow > ul > li").length - 1; }
			MessageWindowDisplayed = index;
			$("#MessageWindow .dummy").fadeIn(200, function() {
				$("#MessageWindow ul .displayed").removeClass("displayed").hide();
				$("#MessageWindow li.image" + index).addClass("displayed").show();
				$("#MessageWindow .dummy").fadeOut(1500);
			});
			$("#MessageWindow .controls .displayed").removeClass("displayed");
			$("#MessageWindow .controls .page" + index).addClass("displayed");
		}
		function startMessageWindow() {
			MessageWindowIntervaler = setInterval(function() { MessageWindowFadeTo(++MessageWindowDisplayed); }, 8000);
		}
		function stopMessageWindow() {
			clearInterval(MessageWindowIntervaler);
		}
		function addMessageWindow() {
			if ($("#MessageWindow")) {
				$("#MessageWindow .controls").append("<span class=\"prevpage\">&nbsp;</span>");
				$("#MessageWindow .prevpage").click( function() { stopMessageWindow(); MessageWindowFadeTo(MessageWindowDisplayed - 1); } );
				$("#MessageWindow > ul > li").each(function(index) {
					
					$("#MessageWindow .controls").append("<span class=\"page page" + index + "\">" + (index+1) + "</span>");
					$("#MessageWindow .controls .page" + index).click( function() { MessageWindowFadeTo(index); } );
					$(this).addClass("image" + index).css("display", "none");
					// is this a video window? if so, set a unique ID for the video tag
					if ($(this).hasClass('video')) {
						var vid = $(this).find('video')[0];
						var videoId = 'message-window-video-'+index;
						$(vid).attr('id', videoId);
						// add events to each player
						_V_(videoId).ready(function(){
							var v = this;
							v.on('play', onPlayVideoMessageWindow);
							v.on('pause', onPauseVideoMessageWindow);
						});
					} else {
						// apply only to non-video slides
						$(this).hover(stopMessageWindow, startMessageWindow);
					}
				});
				$("#MessageWindow").prepend("<div class=\"dummy\"></div>");
				$("#MessageWindow .dummy").hide().width(507).height(422).css("background-color", "#000").css("position", "absolute").css("top", "0px").css("left", "0px").css("z-index", "100");
				//	$("#MessageWindow .dummy").css("z-index", "10000").css("position", "absolute").css("top", "0px").css("left", "0px").css("background-color", "#f0f").css("height", "300").css("width", "400");
				$("#MessageWindow .controls").append("<span class=\"nextpage\">&nbsp;</span>");
				$("#MessageWindow .nextpage").click( function() { stopMessageWindow(); MessageWindowFadeTo(MessageWindowDisplayed + 1); } );
				$("#MessageWindow li.image0").show().addClass("displayed");
				$("#MessageWindow .controls .page0").addClass("displayed");
				startMessageWindow();
			}
		}
		function onPlayVideoMessageWindow(e) {
			stopMessageWindow();
			MessageWindowPlayingVideoId = e.currentTarget.id;
		}
		function onPauseVideoMessageWindow(e) {
			MessageWindowPlayingVideoId = '';
		}
		function pauseVideoMessageWindow() {
			if (MessageWindowPlayingVideoId != '' && $(MessageWindowPlayingVideoId) != null) {
				_V_(MessageWindowPlayingVideoId).pause();
			}
		}

