	    /* Create a questionnaire based on a table and then determine which column meets the needs the best */
		function questionTable() {
		    if ($(".questionnaire table").length > 0) {
				$(".questionnaire table").addClass("questions");
				var question = new Array();
				//Create an array of all options
				$("table.questions tbody tr").each(function() {
			    	theanswers = new Array();
				    q = $(this).find("th").text();
				    $(this).find("td").each( function(index) {
					    theseanswers = $(this).text().split("/");
					    for(var i in theseanswers) {
							found = 0;
							for(var j in theanswers) {
							    if (theanswers[j] == theseanswers[i].replace(/^\s+|\r|\n|\s+$/g, '')) {
									found = 1;
							    }
							}
							if (!found) {
							    theanswers.push(theseanswers[i].replace(/^\s+|\r|\n|\s+$/g, ''));
							}
						}
					});
					question[$(this).find("th").text()] = theanswers;
				});
				var qs = new Array();
	
				//Create the HTML for each question and store it locally
				for (key in question) {
				    answers = "<p>"+key+"</p>";
				    for (var i in question[key]) {
						answers += "<label><input type=\"checkbox\" value=\"1\"/> <span>" + question[key][i] + "</span></label> ";
				    }
				    qs.push(answers);
				}
	
				//Setup the HTML so the module will look right
				$("table.questions").after("<div class=\"buttons\"><span class=\"startover\"><input type=\"button\" value=\"Start Over\"/></span><span class=\"next\"><input type=\"button\" value=\"Next\"/></span></div>").fadeIn();
				$("table.questions").hide().before("<div class=\"steps\">Step 1 of " + qs.length + "</div><div id=\"answers\">" + qs[0] + "</div>");
				$("table.questions tfoot tr").hide();

				$(".startover").hide();
		
				var curview = 1;

				//On restart clear out all the data and set back to the begining
				$(".startover input").click(function() {
		       		curview = 0;
					$("table.questions tbody tr td.green").removeClass("green");
			       	$("table.questions").hide();
			       	//$("#answers").html("<div/>");
			       	$(".next").show();
			       	$(".next input").click();
			       	$(".startover").hide();
			    });


				//When next is clicked either show the next question or show the results
				$(".next input").click(function() {
			     	//Go through all the inputs and set the appropriate ones to green
			     	$("#answers input:checked").each( function() {
						answercheck = $(this).parent().find("span").text().replace(/^\s+|\r|\n|\s+$/g, '');
						$("table.questions tbody tr:eq("+(curview-1)+") td").each( function() {
							answers = $(this).text().split("/");
							for (var i in answers) {
								if (answers[i].replace(/^\s+|\r|\n|\s+$/g, '') == answercheck) {
								    $(this).addClass("green");
								}
							}
						});
					});

				    //Show the reset button if it isn't the first question
			     	if (curview >= 1) {
				 		$(".startover").fadeIn();
			     	}

			    	//If it is the last question
			     	if (curview == qs.length) {
				 		//Display the correct text and show the table.
				 		$("#answers").fadeOut("slow");
				 		$(".next").fadeOut();
				 		$(".steps").html("Complete");
				 		var numcols = $("table.questions tbody tr:first td").length;
				 		var counts = new Array();
				 		for(i=0; i<numcols; i++) { counts[i]=0; }

				 		//count the winners for each column
				 		$("table.questions tbody tr").each( function(index) {
							for(i=0; i<numcols; i++) {
							     counts[i] += $(this).find("td:eq("+i+")").hasClass("green") ? 1 : 0;
							}
						});
				 		winners = new Array();
				 		winner = counts[0];
				 		winners[0] = 0;
				 		//Determine which column won
				 		for(i=1; i<numcols; i++) {
				     		if (counts[i] > counts[i-1]) {
					 			winners = [];
					 			winners.push(i);
					 			winner = counts[i];
				     		} else if (counts[i] == winner) {
					 			winners[winners.length] = i;					 
				     		}
				 		}
				 		results = "";

				 		//Create initial response based on how many answers there are
				 		if (winners.length > 1) {
						    results = "<p>Thank you for filling out the form. Based on the information you provided the following options will work for you: ";
						    for(i=0; i<winners.length; i++) {
							if (i==1 && winners.length == 2) {
							    results += " and ";
							} else if (i>=1 && i!=winners.length-1) {
							    results += ", ";
							} else if (i>1 && i==winners.length-1) {
							    results += ", and ";
					 			}
							results += "<b>"+ $("table.questions thead tr th:eq("+(winners[i]+1)+")").text() +"</b>";
						    }
						    results += ".</p>";
						    winnerslist = "";
						    for(i=0; i<winners.length; i++) {
							if (i>0) { winnerslist += ", "; }
							winnerslist += $("table.questions thead tr th:eq("+(i+1)+")").text();
							results += "<h2>" + $("table.questions thead tr th:eq("+(i+1)+")").text() + "</h2>" + $("table.questions tfoot tr td:eq("+(i+1)+")").html();
						    }
						    pageTracker._trackEvent("Questionaire", window.location, winnerslist);
				 		} else {
						    results = "<p>Thank you for filling out the form. Based on the information you provided the <b>" + $("table.questions thead tr th:eq("+(winners[0]+1)+")").text() + "</b> option works best for you.</p>";
						    results += "<h2>" + $("table.questions thead tr th:eq("+(winners[0]+1)+")").text() + "</h2>" + $("table.questions tfoot tr td:eq("+(winners[0]+1)+")").html();
				 		}
				 		$("#answers").html(results).fadeIn();
				 		$("table.questions").fadeIn();
			     	} else { //Change question
				 		$("#answers").fadeOut("slow", function() {
					    	$(this).html(qs[curview++]).fadeIn();
						});
						$(".steps").html("Step " + (curview+1) + " of " + qs.length);
					}
				});
    		}
		} // end questiontable
	
		/*	setupFilterTable 
		 *	Looks for a table with a class of .filteredtable and adds a box above it for searching within the table
		 *	A filter is required and is added by adding a class in the form of .columnX where X is the column to be used to filter
		 *  For multiple categories in one row add a ', ' between them without the '
		 */
		function setupFilterTable() {
			if($(".filteredtable").length) {
				var classes = $(".filteredtable").attr("class").split(' ');
				var column = -1;
				var keyword = -1;
				var hideoption = -1;
				var prefilter = -1;
				for (var i in classes) {
					var classdata = classes[i].match(/column(\d)/);
					if (classdata != null) {
						column = classdata[1];
					} else {
						classdata = classes[i].match(/keyword(\d)/);
						if (classdata != null) {
						keyword = classdata[1];
						}
					}
					
				}
				if ($("#filteroptions").length > 0) {
				    var options = $("#filteroptions").attr("class").split(' ');
				    for (var i in options) {
					hidecolumn = options[i].match(/hidecolumn(\d)/);
					if (hidecolumn != null) {
					    hideoption = hidecolumn[1];
					} else if (options[i].match(/prefilter/)) {
					    prefilter = $("#filteroptions").attr("title");
					}
				    }
				}
				$(".filteredtable").before("<div id=\"calendar-search\"><p class=\"dropdown\">" + $(".filteredtable thead th:nth-child(" + column + ")").text() + ": <select id=\"filter\"><option value=\"\">View All</option></select></p><p class=\"filtersearch\">Search: <input type=\"text\" id=\"filtersearch\"/></p></div>");
				if (isMobile) {
					$("#calendar-search .filtersearch").append("<input type=\"button\" value=\"Go\">");
				}
				var cats = new Array();
				$(".filteredtable tbody tr td:nth-child(" + column + ")").each(function() {
					var vals = $(this).text().split(", ");
					for (var i in vals) {
						if (jQuery.inArray($.trim(vals[i]), cats) == -1) {
							cats.push($.trim(vals[i]));
						}
					}
				});
				if (keyword > 0) {
					$(".filteredtable tr td:nth-child(" + keyword + ")").css("display", "none");
					$(".filteredtable tr th:nth-child(" + keyword + ")").css("display", "none");
				}
				if (hideoption > 0) {
					$(".filteredtable tr td:nth-child(" + hideoption + ")").css("display", "none");
					$(".filteredtable tr th:nth-child(" + hideoption + ")").css("display", "none");
				}
				cats.sort();
				for (var i in cats) {
					$("#filter").append("<option>"+cats[i]+"</option>");
				}
			
				$("#filter").change(function() {
					searchtable();
				});
				
				$("#filtersearch").keyup(function() {
					searchtable();
				});
				
				function searchtable() {
					/* Filter the table */
					$.uiTableFilter( $('table.filteredtable'), $("#filtersearch").val(), $("#filter").val(), $(".filteredtable thead th:nth-child(" + column + ")").text());
					/* Remove tints from all rows */
					$('table.filteredtable tr').removeClass("even");
					/* Filter through what is still displaying and change the tints */
					var counter = 0;
					$('table.filteredtable tr').each(function() {
									 if($(this).css("display") != "none") {
										 if (counter % 2) {
										 $(this).addClass("even");
										 }
										 counter++;
									 }
									 });
				}
		
				if (prefilter != -1) {
				    $("#filter").val(prefilter);
				    searchtable();
				}
				if ($("#filteroptions.hidefilters").length) {
				    $("#calendar-search").hide();
				}
		

				$('#filter-form').submit(function(){
					return false;
				}).focus(); //Give focus to input field
			}
		}
		
		/* setupWhitepageTable
		 * Creates a table of all the contact at WPI. Uses AJAX to update the list instead of trying to process
		 * all the information on the client side. */
		function setupWhitepageTable() {
		  if ($(".whitepagetable").length) {
			$(".whitepagetable").wrap("<div id=\"directory-container\"/>");
			$("#directory-container").prepend("<div id=\"calendar-search\"><p class=\"dropdown\">Department: <select name=\"filter\" id=\"filter\"><option value=\"\">View All</option></select></p><p>Search: <input type=\"text\" id=\"filtersearch\"/><!--<img src=\"/Images/template/search/ajax-loader.gif\" id=\"whitepagesearchimage\" style=\"display: none\"/>--></p></div>");
			$("#filter").append($("#departments select").html());
			$("#departments").remove();
		
			if(window.location.hash && window.location.hash != "#") {
			  $("#filter").val(unescape(window.location.hash.replace("#", "")));
			} else {
			  $("#filter").attr('selectedIndex',0);
			}
			if (!$.browser.msie) {
				$(".whitepagetable").addClass("rowhover");
			}
			whitepageAjax();
		
		
			$("#filtersearch").keyup(function(event) {
			  //DO NOTHING FOR
			  // shift: 16
			  // ctrl: 17
			  // alt: 18
			  // arrows: 37, 38, 39, 40
			  // space: 32
			  // left window/apple key: 91
			  // right window key: 92
			  // right apple key: 93
			  if (event.keyCode == 16 || event.keyCode == 17 || event.keyCode == 18 || event.keyCode == 37 || event.keyCode == 38 || event.keyCode == 39 || event.keyCode == 40 || event.keyCode == 32 || event.keyCode == 91 || event.keyCode == 92 || event.keyCode == 93) {
				//DO NOTHING
			  }
			  // clear results for
			  // esc: 27
			  else if (event.keyCode == 27 || $(this).val() == '') {
				$(this).val('');
				whitepagesearch($(this).val(), $("#filter").val());
			  } else if (event.keyCode == 13) {
				clearTimeout(whitepagetimeout);
				whitepagesearch($(this).val(), $("#filter").val());
			  } else {
				whitepagesearch($(this).val(), $("#filter").val());
			  }
			});
		
			$("#filter").change(function() {
			  whitepagesearch($("#filtersearch").val(), $(this).val());
			  window.location.hash = escape($(this).val());
			});
		
			$('thead th').each(function(column) {  
			  $(this).addClass('sortable').click(function(){
				$(".whitepagetable").css("opacity", .5);//fadeTo('fast', .5, function() {
				var sortDirection = $(this).is('.sorted-asc') ? -1 : 1;  
		
				//step back up the tree and get the rows with data  
				//for sorting
				var $rows = $(this).parent().parent().parent().find('tbody tr').get();  
		
		
				if ( $(".whitepagetable tbody tr").length > 100 ) {
					//do AJAX search instead of browser sort
				var query = $("#filtersearch").val();
				var dept = $("#filter").val();
				if(sortDirection == 1) { sort = "ASC" }
				else { sort = "DESC" };
		
				col = $('th').filter(':nth-child(' + (column + 1) + ')').text();
		
				$.ajax({
				  url: "/cgi-bin/dirsearch.cgi",
				  cache: true,
				  data: ({s: query, d: dept, sort: col, sortdir: sort}),
				  success: function(html){
					$("tbody").remove();
					$(".whitepagetable").append("<tbody>" + html + "</tbody>").fadeTo('fast', 1);
					stripeTable(".whitepagetable");
				  }
				});
		
				  } else {
					var findSortKey = function($cell) {  
					  return $cell.find('.sort-key').text().toUpperCase() + ' ' + $cell.text().toUpperCase();  
					};
		
					//loop through all the rows and find  
					$.each($rows, function(index, row) {  
					  row.sortKey = findSortKey($(row).children('td').eq(column));  
					});  
		
					//compare and sort the rows alphabetically  
					$rows.sort(function(a, b) {  
					  if (a.sortKey < b.sortKey) return -sortDirection;  
					  if (a.sortKey > b.sortKey) return sortDirection;  
					  return 0;  
					});  
		
					//add the rows in the correct order to the bottom of the table  
					$.each($rows, function(index, row) {  
					  $('tbody').append(row);  
				  row.sortKey = null;  
					});  
		
				$('.whitepagetable .even').removeClass('even');
					stripeTable(".whitepagetable");  
					$(".whitepagetable").fadeTo('fast', 1);
				  }
		
				  //identify the column sort order  
				  $('th').removeClass('sorted-asc sorted-desc');  
				  var $sortHead = $('th').filter(':nth-child(' + (column + 1) + ')');  
				  sortDirection == 1 ? $sortHead.addClass('sorted-asc') : $sortHead.addClass('sorted-desc');  
		
				  //identify the column to be sorted by  
				  $('td').removeClass('sorted')  
						.filter(':nth-child(' + (column + 1) + ')')  
						.addClass('sorted');  
		
				});
			});  
		
		  }
		}
		
