		/* setupMarquee
		 * Takes a list of news items and scrolls them one at a time. The top is is faded in and out
		 */
		function setupMarquee() {
		
			if ($("#marquee").length > 0) {
			    wpi["newsmarquee"] = {
				"changeMainNews": function(carousel, item, idx, state) {
				    $("#marquee .largenews div").animate({opacity:0}, 'slow', function() {
				    	$(this).hide();

						var id = idx;
						id = id % wpi["newsmarquee"].numItems - 1;
						if(id == -1) {id = wpi["newsmarquee"].numItems-1; }
						if(id < 0) { id = wpi["newsmarquee"].numItems - (id * -1); }
						if(id == 0) { id = wpi["newsmarquee"].numItems; }
		
						//$("h1").text(idx + " " + idx%6 + " " + id + " " + wpi["newsmarquee"].numItems + " " + idx%wpi["newsmarquee"].numItems);

						$(this).show();
						$(this).html($("#marquee .newslist .jcarousel-item-"+id+"-vertical div").html()).animate({opacity:1},'fast');
				    });			    	
				},
				"initCallback": function(carousel) {
					// Pause autoscrolling if the user moves with the cursor over the clip.
					carousel.clip.hover(function() {
						carousel.stopAuto();
					}, function() {
						carousel.startAuto();
					});
					
					$("#marquee").hover(function() {
						carousel.stopAuto();
					}, function() {
						carousel.startAuto();
					});
				},
				"carousel": 0,
				"numItems": 0
			    }


			    $("#marquee ul").wrap("<div class=\"newslist\"></div>");			
			    $("#marquee").prepend("<div class=\"largenews\"><div></div></div>");
			    $("#marquee .largenews div").html($("#marquee .newslist ul li:eq(0)").html());
			    wpi["newsmarquee"].numItems = $("#marquee ul li").length;
			    wpi["newsmarquee"].carousel = $("#marquee .newslist ul").jcarousel({
					vertical: true,
					scroll: 1,
					start: 2,
					animation: "slow",
					auto: 5,
					wrap: "circular",
					itemFirstInCallback: {
						onBeforeAnimation: wpi["newsmarquee"].changeMainNews
					},
					initCallback: wpi["newsmarquee"].initCallback
			     });
			}
		}

