		/* addBlog
		 * Gets the link to the blog and adds the additional text to make it a JSON URL
		 * Takes the results of the JSON feed and displays it with an auto rotation.
		 */
		function addBlog() {
			//Check if there is a blog module on the page
			if( $('#modRotatingBlog').length ) {
				var blogPosts = new Array();
				var blogURL = $('#modRotatingBlog div.viewall a').attr('href');
				/* TODO: Check if a trailing / is on the href */
				blogURL += "feed/json/?callback=?";
				$.getJSON(
					  blogURL,
					  function(data) {
						  var desc = "";
						  if (data.description != "") {
						  desc = "<span>"+data.description+"</span>";
						  }
						  $("#modRotatingBlog h3").after("<h4><a href=\""+$("#modRotatingBlog div.viewall a").attr("href")+"\">"+data.title+desc+"</a></h4>");
						  $("#modRotatingBlog h4").after("<ul class=\"posts\"/>");
						  
						  if(data.title.indexOf("Blog") >=0 || data.description.indexOf("Blog") >= 0) {
						  $("#modRotatingBlog h3").remove();
						  }
						  $.each(data.items, function(i, item) {
							 blogpost = "<li><div><img src=\""+item.avatar+"\" class=\"avatar\"/><span class=\"title\"><a href=\""+item.link+"\">"+item.title+"</a></span><span class=\"author\">Posted by: <a href=\""+item.link+"\">"+item.author+"</a></span><br/>"+item.description+"<br/><a href=\""+item.link+"\">Continue Reading</a><br/></div></li>";
							 //		   $("#modRotatingBlog .posts").append(blogpost);
							 blogPosts[i] = blogpost;
							 });
						  
						  $("#modRotatingBlog .posts").after("<span id=\"blog-prev\">&lt;&lt;</span><span id=\"blog-next\">&gt;&gt;</span>");
						  
						  $("#modRotatingBlog .posts ul").html("");
						  
						  $("#modRotatingBlog .posts").jcarousel({
							  auto: 10,
							  scroll: 1,
							  wrap: 'circular',
							  initCallback: blog_initCallback,
							  itemVisibleInCallback: {onBeforeAnimation: blog_itemVisibleInCallback},
							  itemVisibleOutCallback: {onAfterAnimation: blog_itemVisibleOutCallback},
							  buttonNextHTML: null,
							  buttonPrevHTML: null
						  });
					  });
			
				function blog_itemVisibleInCallback(carousel, item, i, state, evt) {
					var idx = carousel.index(i, blogPosts.length);
					carousel.add(i, blogPosts[idx - 1]);
				}
				
				function blog_itemVisibleOutCallback(carousel, item, i, state, evt) {
					carousel.remove(i);
				}
				
				function blog_initCallback(carousel)
				{
					$("#blog-prev").bind('click', function() { 
								 carousel.startAuto(0); 
								 carousel.prev();
								 return false;
							 });
					$("#blog-next").bind('click', function() {
								 carousel.startAuto(0); 
								 carousel.next();
								 return false;
							 });
					
					carousel.clip.hover(function() {
								carousel.stopAuto();
							}, function() {
								carousel.startAuto();
							});
				}
			}
		}
		
		/* addTwitter
		 * Takes the twitter username from the classname and then 
		 * gets the latest tweets and displays them with links for the
		 * @ replies, links, and hashtags.
		 */
		function addTwitter(selector) {
			if ($("#twitter").length > 0) {
				var twitterUsername = $('#twitter').attr('class');
				if(twitterUsername) {
				/* 17 Oct 2012: jbanning changed twitterURL to match
				 * new Twitter API docs.  See:
 				 *    https://dev.twitter.com/docs/api/1/get/statuses/user_timeline
				 */
				 // var twitterURL = "http://twitter.com/status/user_timeline/" + twitterUsername + ".json?count=10&callback=?";
				var twitterURL = "http://api.twitter.com/1/statuses/user_timeline.json?screen_name=" + twitterUsername + "&count=10&callback=?";
				$.getJSON(twitterURL,
					  function(data) {
						  $('#twitter .feed').prepend("<ul/>");
						  var recentPosts = "";
						  for (i=0; i<3; i++) {
						  recentPosts += "<li> "+data[i].text+" </li>";
						  }
						  
						  recentPosts = recentPosts.replace(/(http:\/\/[\w\./-_]+)/gi, "<a href=\"$1\">$1</a>");
						  recentPosts = recentPosts.replace(/@(\w+)/gi, "<a href=\"http://twitter.com/$1\">@$1</a>");
						  recentPosts = recentPosts.replace(/#(\w+)/gi, "<a href=\"http://twitter.com/search?q=%23$1\">#$1</a>");
					  
						  $('#twitter .feed ul').html(recentPosts);
						  //	  addJScrollPane("#twitter .feed ul");
					  });
				}
			}
		}
	
		/* addFlickr
		 * Takes the RSS feed for flickr and converts it to a JSON URL
		 * Then taks the JSON results and displays the 7 most recent images
		 */
		function addFlickr(selector) {
			if ($('#flickr .rss').attr('href')) {
				var feedName = $('#flickr .rss').attr('href');
				feedName = feedName.replace(/rss_200/, "json&jsoncallback=?");
				$.getJSON(feedName,
					function(data) {
						$('#flickr .feed').append("<div class=\"scroll-pane\"><ul/></div>");
						$.each(data.items, function(i, item) {
						 	if (i > 7) { return false; }
						 	var imageURL = item.media.m.replace(/_m/gi, "_s");
						 	$('#flickr .feed ul').append("<li><a href=\""+item.link+"\"><img src=\""+imageURL+"\" /></a></li>");
						});
						//addJScrollPane("#flickr .feed ul");
						setTimeout(function() { $(".scroll-pane").jScrollPane({
							showArrows: true
						}); }, 300);
					});
			}
		}

