(function($){
    $(document).ready(function(){

        setupTodaysHours();

        function setupTodaysHours() {
            if ($("#modHours").length > 0) {

                wpi["hours"] = {
                    "extractTime": function(time) {
                        // 2011-12-14T08:00:00-05:00
                        date = time.split("T");
                        date[0] = date[0].split("-"); // 2011, 12, 14
                        date[1] = date[1].split(":"); // 08, 00, 00-05, 00
                        date_ar = [];
                        date_ar["date"] = [date[0][1], date[0][2], date[0][0]];
                        date_ar["time"] = [date[1][0], date[1][1]];
                        return date_ar;
                    },
                    "getHours": function(open, close) {
                        returntext =  "<li>"+open["date"][0]+"/"+open["date"][1]+"/"+open["date"][2]+"<br>";
                        openampm = "a.m.";
                        closeampm = "a.m.";
                        if (open["time"][0] > 12) {
                            open["time"][0] = open["time"][0]-12;
                            openampm = "p.m.";
                        } else if (open["time"][0] === 0) {
                            open["time"][0] = 12;
                            openampm = "p.m.";
                        } else if (open["time"][0] < 10) {
                            open["time"][0] = open["time"][0]/1;
                        }

                        if (close["time"][0] > 12) {
                            close["time"][0] = close["time"][0]-12;
                            closeampm = "p.m.";
                        } else if (close["time"][0] === 0) {
                            close["time"][0] = 12;
                            closeampm = "p.m.";
                        } else if (open["time"][0] < 10) {
                            close["time"][0] = close["time"][0]/1;
                        }

                        if (open["time"][0] == 12 && open["time"][1] == "00" && openampm == "p.m.") {
                            returntext += "Midnight";
                        } else if (open["time"][0] == 12 && open["time"][1] == "00" && openampm == "a.m.") {
                            returntext += "Noon";
                        } else {
                            returntext += open["time"][0] + ":" + open["time"][1] + " " + openampm;
                        }

                        returntext += " - ";

                        if (close["time"][0] == 12 && close["time"][1] == "00" && closeampm == "p.m.") {
                            returntext += "Midnight";
                        } else if (close["time"][0] == 12 && close["time"][1] == "00" && closeampm == "a.m.") {
                            returntext += "Noon";
                        } else {
                            returntext += close["time"][0] + ":" + close["time"][1] + " " + closeampm;
                        }

                        returntext += "</li>";

                        return returntext;
                    }
                };

                var gcalid = $('#modHours').attr("class");
                gcalid = gcalid.match(/[a-zA-Z0-9]+\@[a-zA-Z0-9\.]+/);
                if (gcalid) {
                    //var gcalURL = "http://www.google.com/calendar/feeds/" + gcalid + "/public/full?alt=json-in-script&orderby=starttime&max-results=3&singleevents=true&sortorder=ascending&futureevents=true&start-min=2011-11-30&start-max=2011-12-01&callback=?";
                    var gcalURL = "https://www.googleapis.com/calendar/v3/calendars/" + gcalid + "/events?key=AIzaSyCGvFYgmm2jqFZIAXmQu118gpyPKoakWdo";
                    $.getJSON(gcalURL,
                        function(data) {

                            //todaysDate = new Date();
                            // TEST
                            // month is zero-based
                            todaysDate = new Date(2015, 0, 16, 0, 30);
                            todaysDate.setFullYear(todaysDate.getFullYear(), todaysDate.getMonth(), todaysDate.getDate());

                            numdisplayed = 0;
                            nextOpenDate = null;
                            nextCloseDate = null;
                            for (i = 0; i < data.items.length; i++) {
                                if (typeof data.items[i].start == 'undefined') {
                                    continue;
                                }

                                var open = wpi["hours"].extractTime(data.items[i].start.dateTime);
                                var close = wpi["hours"].extractTime(data.items[i].end.dateTime);
                                // NOTE: month in Date() is zero-based, hence the -1
                                opendate = new Date(open["date"][2], open["date"][0] - 1, open["date"][1], open["time"][0], open["time"][1]);
                                closedate = new Date(close["date"][2], close["date"][0] - 1, close["date"][1], close["time"][0], close["time"][1]);

                                if (opendate <= todaysDate && todaysDate <= closedate) {
                                    $("#modHours ul").append(wpi["hours"].getHours(open, close));
                                    numdisplayed++;
                                } else if (todaysDate <= opendate) {
                                    // grab the first open date/time that comes next in the list
                                    // this will be the next time we're open
                                    if (nextOpenDate === null) {
                                        nextOpenDate = open;
                                        nextCloseDate = close;
                                        break;
                                    }
                                }
                            }

                            // no time displayed?
                            if (numdisplayed === 0 && nextOpenDate !== null) {
                                $("#modHours ul").append("<li>Currently closed, will open:</li>" + wpi["hours"].getHours(nextOpenDate, nextCloseDate));
                            } else if (numdisplayed === 0) {
                                $("#modHours ul").append("<li>Currently closed.</li>");
                            }

                        }
                    );
                }
            }
        }
    });
})(jQuery);


$(function() {

    // footer <ul> columns
    // works well for 2 or 3 columns, but has problems with more than that
    function footerColumns(cols) {
        var numColumns = typeof cols !== 'undefined' ? cols : 3;
        var initialContainer = $($('#footer .columns')[0]);
        var columnItems = $('#footer .columns li');
        var columns = null;
        var column = 1; // account for initial column
        var itemsPerColumn = null; //to save calc on each itt

        columnItems.detach();

        // destroy any other ul.columns from previous renderings
        $('#footer .columns').each(function(){
            col = $(this);
            // remove all except the first ul.columns
            if (!col.is(initialContainer)) {
                col.remove();
            }
        });

        column++;
        while (column <= numColumns) {
            initialContainer.clone().insertBefore(initialContainer);
            column++;
        }
        columns = $('#footer .columns');

        column = 0;
        itemsPerColumn = (columnItems.length / columns.length);
        columnItems.each(function (idx, el) {
            if (idx !== 0 && idx >= itemsPerColumn * (column + 1)) {
                column += 1;
            }
            $(columns.get(column)).append(el);
        });
    }
    footerColumns(3);

});

